import { Injectable, Query } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class GifServiceService {

  private _historial: string[] = [];
  private apiKey: string = 'J9EkEQEwk1JedQ7LtzSEFCbQFDIqy9fH'

  get historial() {
    return [...this._historial]
  }

 async buscarGif(query: string) {
    query = query.trim().toLocaleLowerCase()
    if (query.trim().length === 0 || this._historial.includes(query)) { return; }
    else {
      this._historial = this._historial.splice(0, 9)
      this._historial.unshift(query);
      console.log(this._historial)
    }
    const resp = await fetch('https://api.giphy.com/v1/gifs/search/tags?api_key=J9EkEQEwk1JedQ7LtzSEFCbQFDIqy9fH&q=dragon ball z&limit=10')
    const data = await resp.json()
    console.log(data);
  }




}
